					<div class="col">
						<h2>Company History</h2>
						<p>eTrucks is a new arm of Axon Software, which is a family-owned private company that has been around since 1982. It first began as an answer to motor carriers in need. We at Axon Software were astonished by the number of calls, email inquiries, and other requests for a simple standalone IFTA program, rather than our full, all-inclusive software suite.</p>
