					<div class="col">
						<p>So, in 2015 we got to work. Drawing on 35+ years of experience in the industry, it wasnt long before we developed something worthy of beta testing and we started receiving feedback from a selected number of real motor carriers in the US and Canada. This period lasted for 15 months and we received some excellent suggestions from our beta users. We were able to improve the program to meet the needs of people looking for a tool to solve their IFTA reporting issues. At the end of 2016, we officially launched the software and made it available for all of North America.</p>
