			<div class="feature--animated__scroll feature--four">
				<div class="row">
					<div class="col">
						<p>Our culture of continuous improvement, our customer-first development process, and the care and consideration we have for everybody who uses our products, has made us one of the best IFTA programs for small and medium sized companies in the motor carrier industry.</p>

						<p>The eTrucks team keeps up with all fuel-tax related news and information that matters to motor carriers. We attend the IFTA/IRP Audit conferences on an annual basis, and keep in touch with the IFTA Audit Committee and IFTA compliance people from around the US and Canada. Our program has not only been built to follow the requirements that IFTA auditors expect to see, but our team also takes the time to make sure our users understand their IFTA reports  not only so that they are completed correctly, but to also learn some handy details about their own business (that can improve profitability!)</p>
					</div><!-- end col -->
					<div class="col animated--one">

